package cn.com.evo.integration.jinanyouxian.sdk.dto;/** * @Description: 获取节目价格接口返回对象 * @author: lu.xin * @create: 2019-04-18 9:22 AM **/public class GetPriceInfoResponse {    /**     * 返回码，返回 0 表示成功，返回其他值表示失败。     */    private Integer ret;    /**     * 返回码对应的描述信息     */    private String ret_msg;    /**     * 节目是否已购买，0 表示未购买，1 表示已购买。     * 当节目不在套餐中或者套餐定价为 0 时，返回 1     */    private Integer is_purchased;    /**     * 总数     */    private Integer total;    /**     * 套餐价格信息列表     */    private String list;    @Override    public String toString() {        return "GetPriceInfoResponse{" +                "ret=" + ret +                ", ret_msg='" + ret_msg + '\'' +                ", is_purchased=" + is_purchased +                ", total=" + total +                ", list='" + list + '\'' +                '}';    }    public Integer getRet() {        return ret;    }    public void setRet(Integer ret) {        this.ret = ret;    }    public String getRet_msg() {        return ret_msg;    }    public void setRet_msg(String ret_msg) {        this.ret_msg = ret_msg;    }    public Integer getIs_purchased() {        return is_purchased;    }    public void setIs_purchased(Integer is_purchased) {        this.is_purchased = is_purchased;    }    public Integer getTotal() {        return total;    }    public void setTotal(Integer total) {        this.total = total;    }    public String getList() {        return list;    }    public void setList(String list) {        this.list = list;    }}